import React from "react";
import { NavLink } from "react-router-dom";
import { BrowserRouter as Router } from "react-router-dom"; // Add this import

import "../CSS/matchSelector.css";
import { useNavigate } from "react-router-dom";

function RankTypeSelector(props) {
  return (
    <Router>
      {" "}
      {/* Add Router component here */}
      <div>
        <br />
        <div className="row">
          <div className="col-1"></div>
          <div className="col-3" style={{ marginTop: "10px" }}>
            <NavLink to="/stats">
              <h6 className="">All</h6>
            </NavLink>
          </div>
          <div className="col-3" style={{ marginTop: "10px" }}>
            <NavLink to="/compare">
              <h6 className="">Compare</h6>
            </NavLink>
          </div>
          <div className="col-3">
            <NavLink to="/rank">
              <h6 className="tab">Rank</h6>
            </NavLink>
          </div>{" "}
        </div>
      </div>
    </Router>
  );
}

export default RankTypeSelector;
